	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 454px; min-height: 277px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 4px; top: 4px; width: 446px; min-height: 269px;\"><p style=\"line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: &quot;Barlow Light&quot;, sans-serif;\"><span style=\"color: rgb(69, 129, 142); font-size:20pt; font-family: Arial, sans-serif;\">Dentist (Operator): </span></p>\n\n<ul style=\"padding: 0px 0px 0px 1px; list-style-position: outside; margin-left: 15px; text-align: left; padding-inline-start: 26px;\">\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: &quot;Barlow Light&quot;, sans-serif; font-size:13pt; color: rgb(255, 255, 255);\"><span style=\" font-size:13pt; font-family:\'Barlow Light\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Back straight, feet flat, elbows close, and oral cavity at elbow height. </span></li>\n</ul>\n\n<p align=\"left\" style=\"margin-left:0px;text-indent:0px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\"background-color:transparent;color:#000000;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Times New Roman\', serif;font-style:normal;\">&nbsp;</span></p>\n\n<p align=\"left\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;\"><span style=\"color: rgb(69, 129, 142); font-size:20pt; font-family: Arial, sans-serif;\">Dental Assistant: </span></p>\n\n<ul style=\"padding: 0px 0px 0px 1px; list-style-position: outside; margin-left: 15px; text-align: left; padding-inline-start: 26px;\">\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: &quot;Barlow Light&quot;, sans-serif; font-size:13pt; color: rgb(255, 255, 255);\"><span style=\" font-size:13pt; font-family:\'Barlow Light\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Seated 4-5 inches higher than the dentist. </span></li>\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: &quot;Barlow Light&quot;, sans-serif; font-size:13pt; color: rgb(255, 255, 255);\"><span style=\" font-size:13pt; font-family:\'Barlow Light\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Straight back, feet on platform, and body facing patient’s head. </span></li>\n</ul>\n\n<p align=\"left\" style=\"margin-left:0px;text-indent:0px;line-height:1.127;margin-top:0px;margin-bottom:0px;\"><span style=\"background-color:transparent;color:#000000;font-weight:normal;text-decoration:normal;font-size:12pt;font-family:\'Times New Roman\', serif;font-style:normal;\">&nbsp;</span></p>\n\n<p align=\"left\" style=\"margin-left:0px;text-indent:0px;line-height:1.384;margin-top:0px;margin-bottom:0px;\"><span style=\"font-size:20pt; color: rgb(69, 129, 142); font-family: Arial, sans-serif;\">Ergonomics: </span></p>\n\n<ul style=\"padding: 0px 0px 0px 1px; list-style-position: outside; margin-left: 15px; text-align: left; padding-inline-start: 26px;\">\n	<li style=\"padding-left: 8px; line-height: 1.384; margin-top: 0px; margin-bottom: 0px; font-family: &quot;Barlow Light&quot;, sans-serif; font-size:13pt; color: rgb(255, 255, 255);\"><span style=\" font-size:13pt; font-family:\'Barlow Light\', sans-serif; color:#ffffff; font-weight:normal; font-style:normal; text-decoration:normal;\">Prevents injuries like carpal tunnel syndrome, neck/back pain, and cumulative trauma disorders. </span></li>\n</ul></div></div>",
